import React, {useEffect, useState} from "react"
import axios from "axios"
import { useParams } from "react-router-dom"
function Vercuenta() {
    const token="eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjYyOTI5NGJkZTc0NDAwMTAxZWFhNDE4ZiIsImlhdCI6MTY1NDY5MDExOSwiZXhwIjoxNjU0Nzc2NTE5fQ.8AL24NLdgNYl8En1K_MWlUsfO7Y9bS3-bMjEPaViek0"
    const [cuentas, setCuentas] = useState([])

    const params = useParams()

    useEffect(()=>{
        console.log(params.id)
        axios.get(`/cuentas/${params.id}`,{ headers: {"x-access-token" : `${token}`} })
        .then(response => setCuentas(response.data))
        .catch(error => console.log(error))
    },[])

      
    return <div className='Cuentas'>
       
    Hoal viendo cuenta
    </div>
    
  
}

export default Vercuenta
